import React from "react";

class Resultado extends React.Component {
  constructor(props) {
    super(props);
    this.state = { resultado: this.props };
  }

  imprimitResultado() {
    console.log(this.props);
    this.setState();
  }

  render() {
    return (
      <body>
        <h1>Resultado</h1>
        <p>{this.props.Resultado}</p>
      </body>
    );
  }
}
export default Resultado;
